import { useEffect } from "react";
import { Outlet,Link, useNavigate } from "react-router-dom"

export const PrivateLayout = ()=>{

  const isLoggedIn  = false;
  const navigate = useNavigate();
 useEffect(()=>{

    if(!isLoggedIn){
      setTimeout(()=>{
    navigate("/entry")
      },3000)
      
       }


 },[isLoggedIn])
 
    return(
        <>
       
        <Outlet/>
        </>
    )
}
